import React from "react";
import "./Button.css";
import { Link } from "react-router-dom";
import { BrowserRouter as Router } from "react-router-dom";
export default function Button() {
  return (
    <div>
      <button className="btn1">+</button>
      <Router>
        <Link to="/Nav"></Link>
      </Router>
    </div>
  );
}
